import './ButtonContainer.css'
import Button from './Button';

function ButtonContainer(props) {

    const   handleClick = buttonName => {
        this.props.clickHandler(buttonName);
      };

    return (
      <div className='button-container'>
        <Button btnName={'1'} onNewClick={props.onBtnClick}/>
        <Button btnName={'2'}/>
        <Button btnName={'3'}/>
        <Button btnName={'4'}/>
        <Button btnName={'5'}/>
        <Button btnName={'6'}/>
        <Button btnName={'7'}/>
        <Button btnName={'8'}/>
        <Button btnName={'9'}/>
        <Button btnName={'+'}/>
        <Button btnName={'-'}/>
        <Button btnName={'*'}/>
        <Button btnName={'/'}/>
        <Button btnName={'='}/>
      </div>
    );
  }

  export default ButtonContainer;
